from collections import Counter
from typing import List

class Solution:
    def destroyTargets(self, nums: List[int], space: int) -> int:
        # All elements returning the same remainder with space can be destroyed together.
        # Find out the max count of such elements and then the min number with this count.
        cntr = Counter([i % space for i in nums])
        print(f'\tcntr = {cntr}')
        max_val = max(cntr.values())
        print(f'\tmax_val = {max_val}')
        keys = [k for k in cntr if cntr[k] == max_val]
        arr = [n for n in nums if n % space in keys]
        return min(arr)
        #arr = list()
        #for num in nums:
